s_paket` = '0'))) AS `total_bp_non_paket`,(select `kia`.`total_harga` from `kia_penanganan` `kia` where (`kia`.`no_ref_pelayanan` = `p`.`no_ref_pelayanan`)) AS `total_kia`,(select sum((`dtl`.`harga` * `dtl`.`qty`)) from (`transaksi_lain` `tl` join `detail_transaksi_lain` `dtl` on((`tl`.`no_transaksi_lain` = `dtl`.`no_transaksi_lain`))) where ((`tl`.`no_ref_pelayanan` = `p`.`no_ref_pelayanan`) and (`dtl`.`no_lain` = '1'))) AS `ekg`,(select sum((`dtl`.`harga` * `dtl`.`qty`)) from (`transaksi_lain` `tl` join `detail_transaksi_lain` `dtl` on((`tl`.`no_transaksi_lain` = `dtl`.`no_transaksi_lain`))) where ((`tl`.`no_ref_pelayanan` = `p`.`no_ref_pelayanan`) and (`dtl`.`no_lain` <> '1'))) AS `lain_lain`,((select coalesce(sum(((`dtrio`.`harga_jual` * `dtrio`.`qty`) * 0.5)),0) from ((`transaksi_rawat_inap` `tri` join `detail_transaksi_rawat_inap_obat` `dtrio` on((`tri`.`no_transaksi_rawat_i` = `dtrio`.`no_transaksi_rawat_i`))) join `obat` `o` on((`dtrio`.`kode_obat` = `o`.`kode_obat`))) where ((`tri`.`no_ref_pelayanan` = `p`.`no_ref_pelayanan`) and (`o`.`no_kat_obat` in ('K001','K002','K003')))) + (select coalesce(sum(((`dtrit`.`harga` * `dtrit`.`qty`) * 0.5)),0) from ((`transaksi_rawat_inap` `tri` join `detail_transaksi_rawat_inap_tindakan` `dtrit` on((`tri`.`no_transaksi_rawat_i` = `dtrit`.`no_transaksi_rawat_i`))) join `rawat_inap_tindakan` `rit` on((`dtrit`.`no_rawat_inap_t` = `rit`.`no_rawat_inap_t`))) where ((`tri`.`no_ref_pelayanan` = `p`.`no_ref_pelayanan`) and (`rit`.`tipe_paket` = '1')))) AS `obat_oral_ri`,(select sum((`dtrit`.`harga` * `dtrit`.`qty`)) from (`transaksi_rawat_inap` `tri` join `detail_transaksi_rawat_inap_tindakan` `dtrit` on((`tri`.`no_transaksi_rawat_i` = `dtrit`.`no_transaksi_rawat_i`))) where ((`tri`.`no_ref_pelayanan` = `p`.`no_ref_pelayanan`) and (`dtrit`.`no_rawat_inap_t` in ('I002','I003')))) AS `japel`,(select sum((`dtrit`.`harga` * `dtrit`.`qty`)) from (`transaksi_rawat_inap` `tri` join `detail_transaksi_rawat_inap_tindakan` `dtrit` on((`tri`.`no_transaksi_rawat_i` = `dtrit`.`no_transaksi_rawat_i`))) where ((`tri`.`no_ref_pelayanan` = `p`.`no_ref_pelayanan`) and (`dtrit`.`no_rawat_inap_t` = 'I001'))) AS `visite`,(select `ps`.`nama` from `pasien` `ps` where (`ps`.`no_rm` = `p`.`no_rm`)) AS `nama_pasien`,'' AS `akomodasi_obat`,'' AS `akomodasi_alkes`,'' AS `akomodasi_lain_lain`,'' AS `jumlah_setoran` from `pelayanan` `p` where (`p`.`status` = 'finish') union select 'Akomodasi' AS `Akomodasi`,'' AS `Name_exp_2`,'' AS `Name_exp_3`,`ari`.`no_akomodasi_rawat_i` AS `no_akomodasi_rawat_i`,'' AS `Name_exp_5`,'' AS `Name_exp_6`,`ari`.`tgl_transaksi` AS `tgl_transaksi`,'' AS `Name_exp_8`,'' AS `Name_exp_9`,'' AS `Name_exp_10`,'' AS `Name_exp_11`,'' AS `Name_exp_12`,'' AS `Name_exp_13`,'' AS `Name_exp_14`,'' AS `Name_exp_15`,'' AS `Name_exp_16`,'' AS `Name_exp_17`,'' AS `Name_exp_18`,'' AS `Name_exp_19`,'' AS `Name_exp_20`,'' AS `Name_exp_21`,(select sum((`daril`.`qty` * `daril`.`harga`)) from (`detail_akomodasi_rawat_inap_logistik` `daril` join `obat` `o` on((`daril`.`kode_obat` = `o`.`kode_obat`))) where ((`daril`.`no_akomodasi_rawat_i` = `ari`.`no_akomodasi_rawat_i`) and (`o`.`tipe` = 'Obat'))) AS `Name_exp_22`,(select sum((`daril`.`qty` * `daril`.`harga`)) from (`detail_akomodasi_rawat_inap_logistik` `daril` join `obat` `o` on((`daril`.`kode_obat` = `o`.`kode_obat`))) where ((`daril`.`no_akomodasi_rawat_i` = `ari`.`no_akomodasi_rawat_i`) and (`o`.`tipe` = 'Alkes'))) AS `Name_exp_23`,(select sum((`daril`.`qty` * `daril`.`harga`)) from `detail_akomodasi_rawat_inap_lain` `daril` where (`daril`.`no_akomodasi_rawat_i` = `ari`.`no_akomodasi_rawat_i`)) AS `Name_exp_24`,'' AS `Name_exp_25` from `akomodasi_rawat_inap` `ari` union select 'Setor Uang' AS `Setor Uang`,`sri`.`id_setoran` AS `id_setoran`,'' AS `Name_exp_3`,'' AS `Name_exp_4`,'' AS `Name_exp_5`,'' AS `Name_exp_6`,`sri`.`tanggal_setor` AS `tanggal_setor`,'' AS `Name_exp_8`,'' AS `Name_exp_9`,'' AS `Name_exp_10`,'' AS `Name_exp_11`,'' AS `Name_exp_12`,'' AS `N